import './index.css';

import ExplanationBox from './ExplanationBox.js';


function Content() {
  return (
    <div class="row">
    <div class="column">
        <h2>Column 1</h2>
        <ExplanationBox></ExplanationBox>
        <ExplanationBox></ExplanationBox>
        <ExplanationBox></ExplanationBox>
        <ExplanationBox></ExplanationBox>
        <ExplanationBox></ExplanationBox>
    </div>
    <div class="column">
        <h2>Column 2</h2>
    </div>
    </div>
  );
}

export default Content;
